const FAQ = () => {
    const [openIndex, setOpenIndex] = useState(0); // First question is open by default

    const toggleQuestion = (index) => {
        setOpenIndex(openIndex === index ? null : index); // Toggle between open and closed
    };

    const faqData = [
        {
            question: "What is Ummati Community?",
            answer:
                "Ummati Community is a ladies-only social group for women of all ages. It plans engaging events for anyone wanting to meet new people and socialize about their common interests.",
        },
        {
            question: "How do I join Ummati Community?",
            answer:
                "Joining the Ummati Community is easy! You can browse our calendar and purchase tickets for the events you want to attend. You can also join our membership and enjoy perks for that.",
        },
        {
            question: "Is there an age range?",
            answer:
                "Our minimum age requirement is 18 years. Mothers can bring their children to events as long as they take responsibility for supervising them.",
        },
        {
            question: "What city is Ummati Community based in?",
            answer:
                "Ummati Community is growing! We currently have chapters in Dallas, TX, Houston, TX, Fort Worth, TX, and Little Rock AR.",
        },
        {
            question: "How can I open a chapter in my city?",
            answer:
                "Ummati Community’s main headquarters is in Dallas, TX. If you want to start your own chapter in your city, visit our ‘Contact Us’ page on our website and submit the form. Our team will set up a meeting with you and help establish a new chapter in your city.",
        },
        {
            question: "How do I contact the event planners?",
            answer:
                "If you have any questions about events, please message us through our Contact Us page on our website or DM us directly on our Instagram.",
        },
        {
            question: "How can I share event ideas?",
            answer:
                "Visit our Contact Us page on our website to send us all of your ideas or DM us on Instagram. We love hearing from you!",
        },
        {
            question: "Is there a membership fee?",
            answer:
                "Yes, we have two membership tiers: a free version where you can pay for each event or a monthly fee covering all event fees for the month. You can check out our membership page for more details and perks.",
        },
        {
            question: "What is the refund policy?",
            answer:
                "We are able to refund tickets to events a week before the event. Refunds requested during the week of the events are non-refundable.",
        },
    ];

    return (
        <div style={styles.pageContainer}>
            <Header />

            {/* Banner Section */}
            <div style={styles.banner}>
                <h1 style={styles.bannerText}>FAQ</h1>
            </div>

            {/* FAQ Content */}
            <div style={styles.faqContainer}>
                {faqData.map((faq, index) => (
                    <div
                        key={index}
                        style={{
                            ...styles.questionBox,
                            height: openIndex === index ? "auto" : "80px", // Adjusted height for closed boxes
                        }}
                    >
                        <div
                            style={styles.questionHeader}
                            onClick={() => toggleQuestion(index)}
                        >
                            <h2 style={styles.questionTitle}>{faq.question}</h2>
                            <div
                                style={{
                                    ...styles.toggleIcon,
                                    transform: openIndex === index ? "rotate(90deg)" : "rotate(0deg)", // Arrow rotation based on state
                                }}
                            >
                                <div style={styles.circle}>
                                    <div style={styles.arrow} />
                                </div>
                            </div>
                        </div>
                        {openIndex === index && (
                            <p style={styles.answerText}>{faq.answer}</p>
                        )}
                    </div>
                ))}
            </div>

            <Footer />
        </div>
    );
};

const styles = {
    pageContainer: {
        width: "100%",
        height: "100%",
        position: "relative",
        background: "#F7F5EF",
    },
    banner: {
        width: "100%",
        height: "220px",
        backgroundImage: `url(${bannerImage})`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
    },
    bannerText: {
        color: "black",
        fontFamily: "Caprasimo",
        fontSize: "56px",
        textAlign: "center",
    },
    faqContainer: {
        padding: "60px 160px",
        display: "flex",
        flexDirection: "column",
        gap: "20px",
    },
    questionBox: {
        padding: "20px 30px",
        background: "white",
        borderRadius: "8px",
        border: "1px solid #C4BAA2",
        display: "flex",
        flexDirection: "column",
        gap: "16px",
        overflow: "hidden",
        cursor: "pointer",
        transition: "height 0.3s ease-in-out",
    },
    questionHeader: {
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
    },
    questionTitle: {
        fontSize: "18px",
        color: "black",
        fontFamily: "Quicksand",
        fontWeight: "700",
        wordWrap: "break-word",
    },
    toggleIcon: {
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        transition: "transform 0.3s",
    },
    circle: {
        width: "40px",
        height: "40px",
        borderRadius: "50%",
        border: "2px solid #78B27B",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        position: "relative",
    },
    arrow: {
        width: "10px",
        height: "10px",
        borderTop: "2px solid #78B27B",
        borderLeft: "2px solid #78B27B",
        transform: "rotate(-45deg)", // Arrow pointing right initially
        position: "absolute",
    },
    answerText: {
        fontSize: "16px",
        color: "#646363",
        fontFamily: "Poppins",
        fontWeight: "400",
        lineHeight: "1.6",
    },
};

export default FAQ;
